def is_prime(n):
    if n < 1:
        return False
    nums = [True for _ in range(n + 1)]
    p = 2
    while p * p <= n:
        if nums[p] is True:
            for i in range(p * 2, n + 1, p):
                nums[i] = False
        p += 1
    return nums[n]

